sys_variable_value.value:
(function execute(inputs, outputs) {
  if (inputs.status == 200) {
    var jsonBody = JSON.parse(inputs.body);
    var myStat = jsonBody.data.segments[0].stats;
    outputs.kills = myStat.kills.value;
    outputs.kdrateo = myStat.kdRatio.value;
    outputs.wins = myStat.wins.value;
  }
  else {
    outputs.error = true;
  }
})(inputs, outputs);

